package com.daengdaeng.domain.pet.domain;import javax.persistence.Column;import javax.persistence.Entity;import javax.persistence.GeneratedValue;import javax.persistence.GenerationType;import javax.persistence.Id;import javax.persistence.Table;import lombok.AccessLevel;import lombok.Getter;import lombok.NoArgsConstructor;@NoArgsConstructor(access = AccessLevel.PROTECTED)@Getter@Entity@Table(name = "mbti_type")public class MbtiType {	@Id	@GeneratedValue(strategy = GenerationType.IDENTITY)	@Column(name = "type_id")	private int typeId;	@Column(name = "type", nullable = false, unique = true)	private char type;}